css:
.atom-jshint-error {
  color: #cb6077;
}
.atom-jshint-pane {
  font-size: 11px;
  line-height: 22px;
  color: #7e705a;
  font-weight: normal;
  background-color: #1d1813;
  overflow: auto;
  max-height: 80px;
  border-top: 1px solid transparent;
  padding: 0 12.5px;
  cursor: pointer;
}
.atom-jshint-pane span:hover {
  text-decoration: underline;
}
